import Header from "./components/Header";
import "./style.css";

function Home() {
  return (
    <div>
      <div className="logo">
        <img src="/logo.png" alt="logo" />
      </div>


      <div className="main">
        <div className="feed">
          <Header />
        </div>
        </div>
        </div>






  );
}

export default Home;
